        let query = phashes[i].clone();
        for j in 0..phashes.len() {
            let item = phashes[j].clone();
            if i == j {
                continue;
            }

            if query.neighbors.contains(&j) {
                continue;
            }

            if query.video_id == item.video_id {
                continue;
            }

            let distance = (query.phash ^ item.phash).count_ones();
            if distance <= max_distance {
                phashes.index_mut(i).neighbors.insert(j);
